INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "お！\nあそこに困ってそうな人発見！", 2, 1, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, 0, 1001, 1, "春咲 ひより", "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "大切な人を\n守れるようになりたい…って", 2, 1, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", 0, 0, 1002, 1, "草野 優衣", "みんなみたいに\nわたしも強くならなきゃ", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "キミに必要な集中力と感性が", 2, 1, 0, "少しは磨かれると思いますよ。", 0, 0, 1003, 1, "士条 怜", "フェンシングを始めてみては？", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.5, "今日はなにして遊ぶ？", 2, 1, 0, "みそぎはねぇ、\nかくれんぼやりたい！", 0, 0, 1004, 1, "穂高 みそぎ", "ねぇ、にいちゃん！", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "ねぇ…", 2, 1, 0, "私といっしょに…\nいかない？", 0, 0, 1006, 1, "風宮 あかり", "風宮あかりです", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.5, "プリンたべたいのー", 2, 1, 0, "食べ物の恨みは怖いのー", 0, 0, 1007, 1, "出雲 宮子", "出雲宮子なのー", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "キミもボクの美貌に\n吸い寄せられたんだね。", 2, 1, 0, "いいよ。\n見られることは運命さ…", 0, 0, 1008, 1, "虹村 雪", "ボクは虹村雪。", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 2, 1, 0, "人呼んで「疾風の冥姫」!!", 0, 0, 1009, 1, "柊杏奈", "フッ…聞いて後悔するがいい！", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.5, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 2, 1, 0, "ほんまおおきにやわ～♪", 0, 0, 1010, 1, "姫宮 真歩", "マホマホ王国のプリンセス、\nまほ姫どす", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "生き別れたお兄ちゃんを探して\n三千世界！", 2, 1, 0, "ここで会ったが\n100年目～！", 0, 0, 1011, 1, "衣之咲 璃乃", "衣之咲璃乃です！", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "ち、超能力って…\n何のことかな～？", 2, 1, 0, "…って、お願い！\n誰にも言わないでおいて～！", 0, 0, 1012, 1, "柏崎 初音", "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "一応カリスマ読モJKやってまっす！", 2, 1, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0, 0, 1016, 1, "美波 鈴奈", "ちょす！\n美波鈴奈だよ～♪", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "東京は遊園地みたいなところさー", 2, 1, 0, "でも、沖縄もとってもいいとこさー", 0, 0, 1017, 1, "喜屋武 香織", "はいたーい。\n喜屋武香織さー。", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "先生って呼ばれるのは\nくすぐったいから", 2, 1, 0, "イオちゃんって呼んでね。", 0, 0, 1018, 1, "支倉 伊緒", "支倉伊緒です。", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.5, "あ！/\お兄ちゃ～ん\nまってよ～", 2, 1, 0, "ミミをおいてかないでぇ～", 0, 0, 1020, 1, "茜 ミミ", "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.5, "あの……\nふぇ……", 2, 1, 0, "ふぇぇぇぇぇん……", 0, 0, 1021, 1, "栗林 くるみ", "あ…あの…えっと…\n栗…林…くるみ…です……", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "こんな私に貴重な時間を\n割いていただき、", 2, 1, 0, "なんてありがとうございます！", 0, 0, 1022, 1, "風宮 より", "風宮よりです。\nあああああ！", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.5, "おにいちゃんどこいくの？\nえ？", 2, 1, 0, "私こっち行きたいー\nね、早く早くー", 0, 0, 1023, 1, "北条 綾音", "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "ふ、不束者ですが\nどうぞ末永く…って、", 2, 1, 0, "これて何か違う…\nあああすみません！", 0, 0, 1025, 1, "天野 すずめ", "わっ…わっ…私、\n天野すずめといいます！", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "あなたは…運命の……\n伴侶……", 2, 1, 0, "離しませんわ………\n絶対に…!!", 0, 0, 1027, 1, "倉石 恵理子", "……クスクス…私は\n…倉石恵理子……", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 2, 1, 0, "…そうでしょ？？", 0, 0, 1028, 1, "佐々木 咲恋", "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "ぇっと…\nキミ、私のこと知らないの?!", 2, 1, 0, "あはは、\n私もまだまだだなぁ～", 0, 0, 1029, 1, "桜井 望", "桜井望だよ！\nよろしくねっ", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "初めまして、\n私はニノン・ジュベール申すデス！", 2, 1, 0, "ショーグン、\nワタシと一緒に天下統一デース！", 0, 0, 1030, 1, "ニノン・ジュベール", "デケデケデンっ！", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "でもって私の隣にいるのが……\nえ、見えない？", 2, 1, 0, "おかしいですね……", 0, 0, 1031, 1, "上喜 しのぶ", "上喜しのぶです。\n手元のドクロが父です。", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.5, "けんども\nそれには足りないモンが…", 2, 1, 0, "そう、\nオラのボケに突っ込める相方が…！", 0, 0, 1033, 1, "野戸まひる", "目指すはビッグな\nお笑い芸人だっぺ！", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "ちょっと緊張しちゃって…", 2, 1, 0, "ちょ\nちょっと一杯飲んできます…！", 0, 0, 1034, 1, "綾瀬 ゆかり", "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.5, "知らない人とは話しちゃいけないので", 2, 1, 0, "これ以上お話しすることは…\nないです！", 0, 0, 1036, 1, "氷川 鏡華", "氷川鏡華…です", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "……あ、アラーム。", 2, 1, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0, 0, 1038, 1, "柏崎 栞", "柏崎…栞です。", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "私、一人も友達がいなくて……", 2, 1, 0, "野に咲く花が、\n唯一の話相手です。", 0, 0, 1040, 1, "双葉 碧", "ふ、双葉碧です。", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 2, 1, 0, "そう思っています。", 0, 0, 1042, 1, "三角 千歌", "三角千歌です。", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "あぁ？\nお前のそいつの仲間か？", 2, 1, 0, "う、疑ってすまなかったな…", 0, 0, 1043, 1, "安芸 真琴", "安芸真琴だ。", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "生けとし生ける全ての者よ！", 2, 1, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0, 0, 1044, 1, "イリヤ・オーンスタイン", "わらわこそは夜を総べる者！", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "ぐふふふふ……はっ！", 2, 1, 0, "ｌク、クウカに何かご用ですか!?", 0, 0, 1045, 1, "遠見 空花", "そこで騎士は妖精を乱暴に……", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 2, 1, 0, "う～ん…\n猫ってホントに最高にゃ～♪", 0, 0, 1046, 1, "宮坂たまき", "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "それでは早速クエストに…", 2, 1, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0, 0, 1048, 1, "大神 美冬", "大神美冬よ！", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "クエストもバトルも\n掃除も洗濯も", 2, 1, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0, 0, 1049, 1, "星野静流", "星野静流だよ！", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.5, "見ての通りの\nセクシー美少女で", 2, 1, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 0, 0, 1050, 1, "玉泉美咲", "アタシは玉泉美咲。", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.4, "？？？？", 2, 1, 0, "？？？？", 0, 0, 1052, 1, "リマ", "？？？", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.5, "菓子でつろうなどと\n稚拙な策を……", 2, 1, 0, "そ、そこまでいうなら\nもらってやる", 0, 0, 1053, 1, "モニカ・ヴァイスヴィント", "モニカ・ヴァイスヴィントだ。", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.5, "菓子でつろうなどと\n稚拙な策を……", 2, 1, 0, "そ、そこまでいうなら\nもらってやる", 0, 0, 1058, 1, "ペコリーヌ", "モニカ・ヴァイスヴィントだ。", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.5, "菓子でつろうなどと\n稚拙な策を……", 2, 1, 0, "そ、そこまでいうなら\nもらってやる", 0, 0, 1059, 1, "コッコロ", "モニカ・ヴァイスヴィントだ。", 0, 0, 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1.5, "菓子でつろうなどと\n稚拙な策を……", 2, 1, 0, "そ、そこまでいうなら\nもらってやる", 0, 0, 1060, 1, "キャル", "モニカ・ヴァイスヴィントだ。", 0, 0, 1);
